model InductorDummy "Ideal linear electrical inductor"
  extends Modelica.Electrical.Analog.Interfaces.OnePort;
  parameter Modelica.SIunits.Inductance L = 1 "Inductance";
  Real di;
equation
  L * di = v;
  annotation(Icon(coordinateSystem(extent = {{-100, -100}, {100, 100}}, preserveAspectRatio = true, initialScale = 0.1, grid = {2, 2}), graphics = {Rectangle(origin = {0.23, 0.47}, fillColor = {170, 85, 255}, fillPattern = FillPattern.Cross, extent = {{-77.52, 22.01}, {77.52, -22.01}})}));
end InductorDummy;
</textarea>  <div id=check2div> </div> <br>
<textarea id=check3textarea>
model IdealSwitchDummy "Ideal electrical switch"
  extends Modelica.Electrical.Analog.Interfaces.OnePort;
  Boolean off(start = false);
  discrete Integer sign_i(start = 0);
  parameter Real t0 = 0.5;
equation
  when time > t0 then
    sign_i = if i > 0 then 1 else -1;
  end when;
  when time > t0 and sign_i * i < 0 then
    off = true;
  end when;
  0 = if off then der(i) else v;
  annotation(Icon(coordinateSystem(extent = {{-100, -100}, {100, 100}}, preserveAspectRatio = true, initialScale = 0.1, grid = {2, 2}), graphics = {Rectangle(origin = {-33.55, 0}, fillPattern = FillPattern.Solid, extent = {{-42.27, 3.05}, {42.27, -3.05}}), Polygon(points = {{0.43573, 37.4728}, {0.43573, 37.4728}}), Polygon(origin = {49.6616, 25.6549}, fillPattern = FillPattern.Solid, points = {{-48.35, -2.12456}, {28.7742, -30.4469}, {31.3886, -23.4753}, {-44.4285, 5.28288}, {-44.4285, 5.71858}, {-48.35, -2.12456}})}));
end IdealSwitchDummy;
</textarea>  <div id=check3div> </div> <br>
<textarea id=check4textarea>
model Test3PhaseSystemsDummySwitch
  constant Real pi = Modelica.Constants.pi;
  parameter Real shift = 0.4;
  parameter Real t0 = 2;
  Real i_abc[3] = {I1.i, I2.i, I3.i};
  Real i_dq0[3];
  Real power;
  Modelica.Electrical.Analog.Basic.Resistor Resistor1(R = 0.5) annotation(Placement(transformation(extent = [-8, 40; 12, 60])));
  InductorDummy I1 annotation(Placement(transformation(extent = [-36, 40; -16, 60])));
  Modelica.Electrical.Analog.Basic.Resistor Resistor2(R = 0.5) annotation(Placement(transformation(extent = [-6, 0; 14, 20])));
  InductorDummy I2 annotation(Placement(transformation(extent = [-36, 0; -16, 20])));
  Modelica.Electrical.Analog.Basic.Resistor Resistor3(R = 0.5) annotation(Placement(transformation(extent = [-4, -40; 16, -20])));
  InductorDummy I3 annotation(Placement(transformation(extent = [-32, -40; -12, -20])));
  Modelica.Electrical.Analog.Sources.SineVoltage S1(freqHz = 1, V = 1, phase = 0) annotation(Placement(transformation(extent = [-60, 40; -40, 60], rotation = 0)));
  Modelica.Electrical.Analog.Sources.SineVoltage S3(freqHz = 1, V = 1, phase = 4 * pi / 3) annotation(Placement(transformation(extent = [-60, -40; -40, -20], rotation = 0)));
  Modelica.Electrical.Analog.Sources.SineVoltage S2(freqHz = 1, V = 1, phase = 2 * pi / 3) annotation(Placement(transformation(extent = [-60, 0; -40, 20], rotation = 0)));
  Modelica.Electrical.Analog.Basic.Ground G annotation(Placement(transformation(extent = [70, -84; 90, -64])));
  Modelica.Electrical.Analog.Sources.SineVoltage SS1(freqHz = 1, V = 1, phase = shift) annotation(Placement(transformation(extent = [60, 40; 80, 60], rotation = 0)));
  Modelica.Electrical.Analog.Sources.SineVoltage SS2(freqHz = 1, V = 1, phase = 2 * pi / 3 + shift) annotation(Placement(transformation(extent = [60, 0; 80, 20], rotation = 0)));
  Modelica.Electrical.Analog.Sources.SineVoltage SS3(freqHz = 1, V = 1, phase = 4 * pi / 3 + shift) annotation(Placement(transformation(extent = [60, -40; 80, -20], rotation = 0)));
  IdealSwitchDummy SW1(t0 = t0) annotation(Placement(transformation(extent = [26, 40; 46, 60])));
  IdealSwitchDummy SW2(t0 = t0) annotation(Placement(transformation(extent = [26, 0; 46, 20])));
  IdealSwitchDummy SW3(t0 = t0) annotation(Placement(transformation(extent = [28, -40; 48, -20])));
protected
  Real theta;
  Real P[3, 3];
  Real di_abc[3] = {I1.di, I2.di, I3.di};
  Real u_abc[3] = {S1.v, S2.v, S3.v};
  Real u_dq0[3];
initial equation
  der(i_dq0) = {0, 0, 0};
equation
  theta = 2 * pi * time;
  P = sqrt(2) / sqrt(3) * [sin(theta), sin(theta + 2 * pi / 3), sin(theta + 4 * pi / 3); cos(theta), cos(theta + 2 * pi / 3), cos(theta + 4 * pi / 3); 1 / sqrt(2), 1 / sqrt(2), 1 / sqrt(2)];
  u_dq0 = P * u_abc;
  i_dq0 = P * i_abc;
  power = u_dq0 * i_dq0;
  der(i_dq0) = 2 * pi * {i_dq0[2], -i_dq0[1], 0} + P * di_abc;
  connect(I2.n, Resistor2.p) annotation(Line(points = [-16, 10; -6, 10], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(I1.n, Resistor1.p) annotation(Line(points = [-16, 50; -8, 50], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(I3.n, Resistor3.p) annotation(Line(points = [-12, -30; -4, -30], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(I1.p, S1.n) annotation(Line(points = [-36, 50; -40, 50], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(S3.n, I3.p) annotation(Line(points = [-40, -30; -32, -30], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(S2.n, I2.p) annotation(Line(points = [-40, 10; -36, 10], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(S1.p, S2.p) annotation(Line(points = [-60, 50; -60, 10], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(S2.p, S3.p) annotation(Line(points = [-60, 10; -60, -30], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(S3.p, G.p) annotation(Line(points = [-60, -30; -60, -64; 80, -64], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(SS1.n, SS2.n) annotation(Line(points = [80, 50; 80, 10], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(SS2.n, SS3.n) annotation(Line(points = [80, 10; 80, -30], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(SS3.n, G.p) annotation(Line(points = [80, -30; 80, -64], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(Resistor1.n, SW1.p) annotation(Line(points = [12, 50; 26, 50], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(SW1.n, SS1.p) annotation(Line(points = [46, 50; 60, 50], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(Resistor2.n, SW2.p) annotation(Line(points = [14, 10; 26, 10], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(SW2.n, SS2.p) annotation(Line(points = [46, 10; 60, 10], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(Resistor3.n, SW3.p) annotation(Line(points = [16, -30; 28, -30], style(color = 3, rgbcolor = {0, 0, 255})));
  connect(SW3.n, SS3.p) annotation(Line(points = [48, -30; 60, -30], style(color = 3, rgbcolor = {0, 0, 255})));
end Test3PhaseSystemsDummySwitch;
